import classes from './Post.module.css';


const Post = (props) => {
   return (
         <div className={classes.item}>
           <img src='https://encrypted-tbn0.gstatic.com/images?q=tbn%3AANd9GcSxLkbtTa0kfmKizxJgqECQLdlt_xq1R2jEQQ&usqp=CAU'></img>
           {props.message}
           <div>
            <span>{props.like}like</span>
           </div>
         </div>
   )
}

export default Post;
